    true,nt"url": null,nt"notes": "This repository contains Privacy Impact
    Assessments (PIA) that have been vetted/approved. rnSection 208 of the Electronic
    Government Act of 2002 (E-Gov Act) requires federal agencies to conduct a Privacy
    Impact Assessment (PIA) on information technology systems that either (1) collect,
    maintain, and/or disseminate Personally Identifiable Information (PII); or (2) make
    substantial changes to existing technology that manages PII.. A PIA is an analysis
    of how PII is collected, stored, protected, shared, and managed. Its purpose is
    to demonstrate that the information system owners and/or developers have incorporated
    privacy protections throughout the lifecycle of the system. Absent a legitimate
    security or sensitivity concern demonstrated by the agency, the E-Gov Act requires
    agencies to make PIAs publicly available.rnThe Department of Veterans Affairs (VA)
    Office of Privacy, FOIA, and Records Management strive to be the leader among Federal
    Information Technology (IT) organizations in protecting the privacy of Veterans'
    personal data. Our goal is to respond to mandates to meet the needs of Veterans,
    while improving the protection of their personal information.rnTo view a PIA for
    a particular system, go to the heading labeled 'System Operating with a Current/Valid
    FY2013 PIA' and select the name of the program/project of interest.",nt"license_title":
